import React from "react";

const SettingsPage: React.FC = () => {
  return (
    <div>
      <h1 style={{ fontSize: 24, marginBottom: 16 }}>Settings</h1>
      <p>여기에 언어, 테마, 알림 같은 환경설정 섹션을 넣으면 됩니다.</p>
    </div>
  );
};

export default SettingsPage;
